import React from "react";
import logo from '../img/logo_veelo.png';
import '../css/Header.css';

const styles = {
    transition: 'all 1s ease-in-out'
};

class Header_Navbar extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            scale: 1,
            left: 0
        }

    }

    onScale(){
        this.setState({
            scale: 1.5
        })
    }

    render() {
        var cleft = -100;
        var ctrans = 'translate('+cleft+'px';
        var css = {
            transform: ctrans
        };
        return (
            <div className="row pt-2 align-text-bottom">
                <div className="logo">
                    <a className="navbar-brand" href="#">
                        <img src={logo} style={{height: 50}}/>
                    </a>
                </div>
                <div className="acceuilSelect" style={css}>
                    <a onClick={this.onScale.bind(this)}> <p>Acceuil</p></a>
                </div>
                <div className="adminNotSelect">
                    <p>Administration</p>
                </div>
            </div>
        )
    }

}

export default Header_Navbar;
